import classes from './Header.module.css';

function Header(props) {

    return (
        <div
            className={classes.Header}>
            <div>
                <div className={classes.Brand}>
                    Memory
                </div>
                <div
                    className={classes.Info}
                    onClick={props.onShowAbout}>
                    About this app
                </div>   
            </div>  
        </div>
    );
}

export default Header;
